/* ============================================================
 * Video Player Script
 * ------------------------------------------------------------
 * Handles dynamic video loading from:
 *  - Local file upload
 *  - HLS (.m3u8) link
 *  - MP4 video link
 * Includes default demo video on initial load.
 * ============================================================ */

function loadPlayer(url) {
  if (window.player && typeof window.player.api === "function") {
    window.player.api("destroy");
  }
  window.player = new Playerjs({ id: "player", file: url });
}

document
  .getElementById("fileInput")
  .addEventListener("change", function (event) {
    const file = event.target.files[0];
    if (file) loadPlayer(URL.createObjectURL(file));
  });

document.getElementById("loadHLS").addEventListener("click", function () {
  const hlsURL = document.getElementById("hlsLink").value.trim();
  if (hlsURL) loadPlayer(hlsURL);
});

document.getElementById("loadMp4").addEventListener("click", function () {
  const mp4URL = document.getElementById("mp4Link").value.trim();
  if (mp4URL) loadPlayer(mp4URL);
});

document.addEventListener("DOMContentLoaded", () => {
  loadPlayer("https://cdn.pixabay.com/vimeo/943220304/943220304-720p.mp4");
});


